    i = len(x) - 1
    while i >= 0 and x[i] == '!':
        xcount += 1
        i -= 1
    i = len(y) - 1
    while i >= 0 and y[i] == '!':
        ycount += 1
        i -= 1
    new_x = int(x[:len(x) - xcount]) if xcount < len(x) else 0
    new_y = int(y[:len(y) - ycount]) if ycount < len(y) else 0
    if new_x == 0 and xcount > 0:
        new_x = 1
    if new_y == 0 and ycount > 0:
        new_y = 1
    sflag = False
    if xcount > ycount:
        (new_x, new_y) = (new_y, new_x)
        (xcount, ycount) = (ycount, xcount)
        sflag = True
    ycount += xcount
    dflag = False
    while ycount > 0:
        ycount -= 1
        val = new_y - 1
        while val > 0:
            new_y *= val
            val -= 1
            if new_y > new_x:
                dflag = True
                break
        if dflag:
            break
    if sflag:
        (new_x, new_y) = (new_y, new_x)
    if new_x > new_y:
        return 'x>y'
    elif new_x == new_y:
        return 'x=y'
    else:
        return 'x<y'

